import React from 'react'
import RecipeList from './components/RecipeList'


function App() {
  return (
    <RecipeList />
  );
}

const sampleRecipes = {
  id: 1,
  name: 'Plain Chicken',
  servings: 3,
  cookTime: '1:45',
  instructions: "1. Put salt on chicken\n 2. Put chicken in oven\n 3. Eat chicken"

}

export default App;
